            <a th:each="toillete:${toilletes}" th:href="${toillete.extraLink}">
                <circle id="pointA" th:cx="${toillete.mapCordinatX}" th:cy="${toillete.mapCordinatY}" r="8"

                <text fill="#ffffff" class="spotLetter" font-size="10" font-family="Verdana"

                <text fill="#ffffff" font-size="10" font-family="Verdana" th:x="${festival.mapCordinatX} - 4"

                <text  fill="#ffffff" font-size="10" font-family="Verdana" th:x="${voedselKraampje.mapCordinatX} - 4"

        <div class="row map-filter">
            <p class="col-1" style="color: #0022cc; max-width: 25px; background-color: #0022cc; border-radius: 50px">
                °</p>
            <p class="col-4 map-filter-text" th:text="#{toilettes}"> Toilletes </p>
            <input class="col-1 map-checkBox" type="checkbox" name="filterToillet" value="true" th:checked="${filterToillet}==true">
        </div>
        <div class="row map-filter">
            <p class="col-1 " style="color: #932222; max-width: 25px; background-color: #932222; border-radius: 50px">
                °</p>
            <p class="col-4 map-filter-text"> Festivals </p>
            <div class="col-1">
                <input class="map-checkBox" type="checkbox" name="filterFestival" value="true"
                       th:checked="${filterFestival}==true">
            </div>

        </div>
        <div class="row map-filter">
            <p class="col-1" style="color: #218630; max-width: 25px; background-color: #218630; border-radius: 50px">
                °</p>
            <p class="col-4 map-filter-text" th:text="#{foodstalls}">VoedselKraampjes </p>
            <input class="col-1 map-checkBox" type="checkbox" name="filterVoedKraam" value="true"
                   th:checked="${filterVoedKraam}==true">
        </div>
        <input type="submit" value="filter" th:href="@{/map/filter}">
        <input style="visibility: hidden;" type="text" name="lang" th:value="#{lang.source}">
    </form>
